import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

import AdminDashboard from './Pages/AdminDashboard';
import FleetDashboard from './Pages/Modules/Fleetmanagement/Fleetmanagement';
import OilManagement from './Pages/Modules/OilManagement/OilManagement';
import CityOperations from './Pages/Modules/CityOperations/CityOperations';
import UserManagement from './Pages/Modules/UserManagement/UserManagement';

import Login from '../src/Pages/Login';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<AdminDashboard />} />
        <Route path="/fleet" element={<FleetDashboard />} />
        <Route path="/oil" element={<OilManagement />} />
        <Route path="/city" element={<CityOperations />} />
        <Route path="/users" element={<UserManagement />} />

        <Route path="/login" element={<Login />} />
      </Routes>
    </Router>
  );
}

export default App;
